import React from 'react';

import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogTitle from '@material-ui/core/DialogTitle';
import TextField from '@material-ui/core/TextField';

class CreatePlaylistDialog extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            open: false,
            playlistName: "",
        };
        this.handleDialogOpen = this.handleDialogOpen.bind(this);
        this.handleDialogClose = this.handleDialogClose.bind(this);
        this.handleNameChange = this.handleNameChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleDialogOpen() {
        this.setState({ open: true })
    }

    handleDialogClose() {
        this.setState({
            open: false,
            playlistName: "",
        })
    }

    handleSubmit(event) {
        this.props.parentCallback(this.state.playlistName);
        this.setState({
            playlistName: "",
            open: false,
        });
        event.preventDefault();
    }

    handleNameChange(event) {
        this.setState({ playlistName: event.target.value })
    }

    render() {
        return (
            <div>
                <svg
                    xmlns="http://www.w3.org/2000/svg"
                    width="26"
                    height="26"
                    fill="currentColor"
                    className="bi bi-plus"
                    viewBox="0 0 16 16"
                    onClick={this.handleDialogOpen}
                >
                    <path d="M8 4a.5.5 0 0 1 .5.5v3h3a.5.5 0 0 1 0 1h-3v3a.5.5 0 0 1-1 0v-3h-3a.5.5 0 0 1 0-1h3v-3A.5.5 0 0 1 8 4z" />
                </svg>


                <Modal show={this.state.open} onHide={() => handleDialogClose} animation={false}>
                <Modal.Header closeButton>
                    Login
                </Modal.Header>
                <Modal.Body>
                    <form>
                        <div className="form-group text-left">
                            <label >Email address</label>
                            <input type="email"
                                className="form-control"
                                id="email"
                                aria-describedby="emailHelp"
                                placeholder="Enter email"
                                value={state.email}
                                onChange={handleChange}
                            />
                        </div>
                        <div className="form-group text-left">
                            <label>Password</label>
                            <input type="password"
                                className="form-control"
                                id="password"
                                placeholder="Password"
                                value={state.password}
                                onChange={handleChange}
                            />
                        </div>
                        <div className="form-check">
                        </div>
                    </form>
                    <Button
                        type="submit"
                        className="btn btn-primary"
                        onClick={handleSubmitClick}
                    >Submit</Button>
                </Modal.Body>
                <Modal.Footer>
                    <div className="registerMessage">
                        <span>Dont have an account? </span>
                        <span className="loginText" onClick={() => redirectToRegister()}>Register</span>
                    </div>
                    <div className="alertMessage" style={{ display: state.errorMessage ? 'block' : 'none' }} role="alert">
                        {state.errorMessage}
                    </div>
                </Modal.Footer>
            </Modal>


                <Dialog
                    open={this.state.open}
                    onClose={this.handleDialogClose}>
                    <DialogTitle>Add a playlist</DialogTitle>
                    <DialogContent>
                        <TextField
                            value={this.state.playlistName}
                            onChange={this.handleNameChange}
                            autoFocus
                            margin="dense"
                            label="Song name"
                            fullWidth
                        />
                    </DialogContent>

                    <DialogActions>
                        <Button onClick={this.handleDialogClose} color="primary">
                            Close
                     </Button>
                        <Button onClick={this.handleSubmit} color="primary">
                            Submit
                         </Button>
                    </DialogActions>
                </Dialog>
            </div>
        )
    }
}

export default CreatePlaylistDialog;
